sparqlQuery:
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?string
WHERE {
        res:University_of_Oxford dbo:officialSchoolColour ?string . 
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri
WHERE {
        ?uri dbo:launchPad res:Baikonur_Cosmodrome .
}
